# Importing our tools
import numpy as np
import pandas as pd
import torch
import transformers as ppb
from sklearn.linear_model import LogisticRegression
from sklearn.model_selection import cross_val_score
from sklearn.model_selection import train_test_split

# Get the data from github as dataframe:
df = pd.read_csv('https://github.com/clairett/pytorch-sentiment-classification/raw/master/data/SST2/train.tsv',
                 delimiter='\t', header=None
                 )
# Get the first 2000:
df = df[:2000]

# Let's take a look at the data:
df.head()

# Importing our pre-trained model: DistilBert and its tokenizer
model_class, tokenizer_class, pretrained_weights = (
    ppb.DistilBertModel, ppb.DistilBertTokenizer, 'distilbert-base-uncased'
)

# Load the pretrained model/tokenizer
tokenizer = tokenizer_class.from_pretrained(pretrained_weights)
model = model_class.from_pretrained(pretrained_weights)

# Tokenization
tokenized = df[0].apply((
    lambda x: tokenizer.encode(x, add_special_tokens=True)
))

# padding
max_len = 0
for i in tokenized.values:
    if len(i) > max_len:
        max_len = len(i)

padded = np.array([i + [0]*(max_len - len(i)) for i in tokenized.values])

# Check the input shape:
np.array(padded).shape

"""![image.png](data:image/png;base64,)"""

# The attention mask
attention_mask = np.where(padded != 0, 1, 0)
attention_mask.shape

input_ids = torch.tensor(padded)
attention_mask = torch.tensor(attention_mask)

with torch.no_grad():
    last_hidden_states = model(input_ids, attention_mask=attention_mask)

features = last_hidden_states[0][:, 0, :].numpy()

labels = df[1]

# Split the data
train_features, test_features, train_labels, test_labels = train_test_split(features, labels)

# Logistic Regression
lr_clf = LogisticRegression()
lr_clf.fit(train_features, train_labels)

lr_clf.score(test_features, test_labels)

"""How good is this score? What can we compare it against? Let's first look at a dummy classifier:"""

from sklearn.dummy import DummyClassifier
clf = DummyClassifier()

scores = cross_val_score(clf, train_features, train_labels)
print('Dummy classifier score: %.3f (+/- %.2f)' % (scores.mean(), scores.std()*2))

"""So we can see clearly that our model is better that a dummy classifier"""

